The Key trait declares two functions: as_big_endian_bytes() and from_big_endian_bytes . The intention is to convert the type to bytes using a network byte order for numerical types, and for non-numerical types, the bytes need to be stored in binary-sortable order. Here is how BonsaiDb implements Key for EnumKey: impl<T> Key for T
where T: EnumKey,
{ type Error = std::io::Error; const LENGTH: Option<usize> = None; fn as_big_endian_bytes(&self) -> Result<Cow<'_, [u8]>, Self::Error> { let integer = self .to_u64() .map(Unsigned::from) .ok_or_else(|| std::io::Error::new(ErrorKind::InvalidData, IncorrectByteLength))?; Ok(Cow::Owned(integer.to_variable_vec()?)) } fn from_big_endian_bytes(bytes: &[u8]) -> Result<Self, Self::Error> { let primitive = u64::decode_variable(bytes)?; Self::from_u64(primitive) .ok_or_else(|| std::io::Error::new(ErrorKind::InvalidData, UnknownEnumVariant)) }
} By implementing Key you can take full control of converting your view keys.

