The CustomApi trait defines three associated types, Request, Response, and Error. A backend "dispatches" Requests and expects a Result<Response, Error> in return. All code on this page comes from this example: examples/basic-server/examples/custom-api.rs . This example defines a Request and a Response type, but uses BonsaiDb's Infallible type for the error: #[derive(Serialize, Deserialize, Actionable, Debug)]
#[actionable(actionable = bonsaidb::core::actionable)]
pub enum Request { #[actionable(protection = "none")] Ping, #[actionable(protection = "simple")] DoSomethingSimple { some_argument: u32 }, #[actionable(protection = "custom")] DoSomethingCustom { some_argument: u32 },
} #[derive(Serialize, Deserialize, Debug, Clone)]
pub enum Response { Pong, DidSomething,
} impl CustomApi for ExampleApi { type Request = Request; type Response = Response; type Error = Infallible;
} To implement the server, we must first implement a custom Backend that ties the server to the CustomApi. We also must define a CustomApiDispatcher , which gives an opportunity for the dispatcher to gain access to the ConnectedClient and/or `CustomServer instances if they are needed to handle requests. Finally, either Dispatcher must be implemented manually or actionable can be used to derive an implementation that uses individual traits to handle each request. The example uses actionable: impl Backend for ExampleBackend { type CustomApi = ExampleApi; type CustomApiDispatcher = ExampleDispatcher; type ClientData = ();
} /// Dispatches Requests and returns Responses.
#[derive(Debug, Dispatcher)]
#[dispatcher(input = Request, actionable = bonsaidb::core::actionable)]
pub struct ExampleDispatcher { // While this example doesn't use the server reference, this is how a custom // API can gain access to the running server to perform database operations // within the handlers. The `ConnectedClient` can also be cloned and stored // in the dispatcher if handlers need to interact with clients outside of a // simple Request/Response exchange. _server: CustomServer<ExampleBackend>,
} impl CustomApiDispatcher<ExampleBackend> for ExampleDispatcher { fn new( server: &CustomServer<ExampleBackend>, _client: &ConnectedClient<ExampleBackend>, ) -> Self { Self { _server: server.clone(), } }
} #[async_trait]
impl RequestDispatcher for ExampleDispatcher { type Output = Response; type Error = BackendError<Infallible>;
} /// The Request::Ping variant has `#[actionable(protection = "none")]`, which
/// causes `PingHandler` to be generated with a single method and no implicit
/// permission handling.
#[async_trait]
impl PingHandler for ExampleDispatcher { async fn handle( &self, _permissions: &Permissions, ) -> Result<Response, BackendError<Infallible>> { Ok(Response::Pong) }
} Finally, the client can issue the API call and receive the response, without needing any extra steps to serialize. This works regardless of whether the client is connected via QUIC or WebSockets. async fn ping_the_server( client: &Client<ExampleApi>, client_name: &str,
) -> Result<(), bonsaidb::core::Error> { match client.send_api_request(Request::Ping).await { Ok(Response::Pong) => { println!("Received Pong from server on {}", client_name); } other => println!( "Unexpected response from API call on {}: {:?}", client_name, other ), } Ok(())
}

