One of the strengths of using BonsaiDb's custom api functionality is the ability to tap into the permissions handling that BonsaiDb uses. The Ping request was defined with protection = "none" which skips all permission validation. However, DoSomethingSimple uses the "simple" protection model, and DoSomethingCustom uses the "custom" protection model. The comments in the example below should help explain the rationale: /// The permissible actions that can be granted for this example api.
#[derive(Debug, Action)]
#[action(actionable = bonsaidb::core::actionable)]
pub enum ExampleActions { DoSomethingSimple, DoSomethingCustom,
} /// With `protection = "simple"`, `actionable` will generate a trait that allows
/// you to return a `ResourceName` and an `Action`, and the handler will
/// automatically confirm that the connected user has been granted the ability
/// to perform `Action` against `ResourceName`.
#[async_trait]
impl DoSomethingSimpleHandler for ExampleDispatcher { type Action = ExampleActions; async fn resource_name<'a>( &'a self, _some_argument: &'a u32, ) -> Result<ResourceName<'a>, BackendError<Infallible>> { Ok(ResourceName::named("example")) } fn action() -> Self::Action { ExampleActions::DoSomethingSimple } async fn handle_protected( &self, _permissions: &Permissions, _some_argument: u32, ) -> Result<Response, BackendError<Infallible>> { // The permissions have already been checked. Ok(Response::DidSomething) }
} /// With `protection = "custom"`, `actionable` will generate a trait with two
/// functions: one to verify the permissions are valid, and one to do the
/// protected action. This is useful if there are multiple actions or resource
/// names that need to be checked, or if permissions change based on the
/// arguments passed.
#[async_trait]
impl DoSomethingCustomHandler for ExampleDispatcher { async fn verify_permissions( &self, permissions: &Permissions, some_argument: &u32, ) -> Result<(), BackendError<Infallible>> { if *some_argument == 42 { Ok(()) } else { permissions.check( ResourceName::named("example"), &ExampleActions::DoSomethingCustom, )?; Ok(()) } } async fn handle_protected( &self, _permissions: &Permissions, _some_argument: u32, ) -> Result<Response, BackendError<Infallible>> { // `verify_permissions` has already been executed, so no permissions // logic needs to live here. Ok(Response::DidSomething) }
} This example uses authenticated_permissions to grant access to ExampleAction::DoSomethingSimple and ExampleAction::DoSomethingCustom to all users who have logged in: let server = CustomServer::<ExampleBackend>::open( ServerConfiguration::new("server-data.bonsaidb") .default_permissions(Permissions::from(vec![Statement { resources: vec![ResourceName::any()], actions: ActionNameList::List(vec![ BonsaiAction::Server(ServerAction::Connect).name(), BonsaiAction::Server(ServerAction::LoginWithPassword).name(), ]), }])) .authenticated_permissions(Permissions::from(vec![Statement { resources: vec![ResourceName::any()], actions: ActionNameList::List(vec![ ExampleActions::DoSomethingSimple.name(), ExampleActions::DoSomethingCustom.name(), ]), }])), ) .await?; For more information on managing permissions, see Administration/Permissions

