A View is a map/reduce -powered method of quickly accessing information inside of a Collection . A View can only belong to one Collection. Views define two important associated types: a Key type and a Value type. You can think of these as the equivalent entries in a map/dictionary-like collection that supports more than one entry for each Key. The Key is used to filter the View's results, and the Value is used by your application or the reduce() function. Views are a powerful, yet abstract concept. Let's look at a concrete example: blog posts with categories. #[derive(Serialize, Deserialize, Debug)]
pub struct BlogPost { pub title: String, pub body: String, pub category: Option<String>,
} While category should be an enum, let's first explore using String and upgrade to an enum at the end (it requires one additional step). Let's implement a View that will allow users to find blog posts by their category as well as count the number of posts in each category. impl View for BlogPostsByCategory { type Collection = BlogPost; type Key = Option<String>; type Value = u32; fn name(&self) -> Result<Name, InvalidNameError> { Name::new("by-category") }
} impl ViewSchema for BlogPostsByCategory { type View = Self; fn map(&self, document: &Document) -> ViewMapResult<Self::View> { let post = document.contents::<BlogPost>()?; Ok(document.emit_key_and_value(post.category, 1)) } fn reduce( &self, mappings: &[ViewMappedValue<Self::View>], _rereduce: bool, ) -> ReduceResult<Self::View> { Ok(mappings.iter().map(|mapping| mapping.value).sum()) }
} The two traits being implemented are View and ViewSchema . These traits are designed to allow keeping the View implementation in a shared code library that is used by both client-side and server-side code, while keeping the ViewSchema implementation in the server executable only.
